import styled from 'styled-components';

export const NavStyled = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  background-color: #313132;
`;

export const UlStyled = styled.ul`
  display: flex;
  list-style: none;
  font-size: 12px;
  margin-left: 10%;
`;

export const LiStyled = styled.li`
  padding: 8px 10px;
  margin: 10px;
  color: white;
`;
